import React from 'react';

const PlayerItem = (props) => {
  return (
    <tr>
      <td>{props.ranking}</td>
      <td>{props.name}</td>
      <td>{props.country}</td>
      <td>@{props.age}</td>
      <td>@{props.points}</td>
    </tr>
  );
};

export default PlayerItem;
